import json
from mb.logger import MBLogger
from mb.config import WEBSITE_TYPE_BUSINESS, WEBSITE_CATEGORY_REQUEST_FIELDS, WEBSITE_LIST_REQUEST_FIELDS, APP_KEY, APP_SECRET
from mb.alliance import YiqifaAPI, WebsiteCategoryReqeust, WebsiteListRequest
from mb.db import MBDB

#################Alliance Task Start###################
'''获取联盟信息Task'''

class AllianceError(Exception):
    def __init__(self, message):
        self.message = message
    
    def __str__(self):
        return repr(self.message)
    
class AllianceTask():
    
    catIdNameMap = {}
    
    def execRequest(self, reqObj, loggerTag):
        apiObj = YiqifaAPI(APP_KEY, APP_SECRET)
        jsonStr = apiObj.call(reqObj)
        MBLogger.debug("%s: %s" % (loggerTag, jsonStr))
        jsonObj = json.loads(jsonStr)
        if jsonObj.has_key('errors'):
            errors = []
            for errorInfo in jsonObj['errors']['error']:
                errors.append("ErrorCode[%s] - Message[%s]" % (errorInfo['error_code'], errorInfo['msg']))
            raise AllianceError(",".join(errors))
        return jsonObj
    
    def getWebsiteList(self):
        webCats = self.getCategory()
        wlr = WebsiteListRequest(WEBSITE_LIST_REQUEST_FIELDS, webCats, WEBSITE_TYPE_BUSINESS)
        webCatsJson = self.execRequest(wlr, "Alliance Website lists Information")
        return webCatsJson
        
    def getCategory(self):
        wcr = WebsiteCategoryReqeust(WEBSITE_CATEGORY_REQUEST_FIELDS, WEBSITE_TYPE_BUSINESS)
        categoryJson = self.execRequest(wcr, "Alliance Category Information")
        webCats = []
        for webCategoryInfo in categoryJson['response']['web_cats']['web_cat']:
            webCats.append(webCategoryInfo['web_catid'])
            self.catIdNameMap[webCategoryInfo['web_catid']] = webCategoryInfo['web_cname']
        return ",".join(webCats)
    
    def getCallable(self):
        return self.getWebsiteList
        
    def getArgs(self):
        return None
    
    def getCallback(self):
        return self.handleAllianceInfo

    '''处理联盟信息的回调函数'''
    def handleAllianceInfo(self, request, result):
        for webInfo in result['response']['web_list']['web']:
            result = MBDB.query("insert into electric_purchaser " \
               "set merchant_id=$merchant_id, name=$name, merchant_cat_id=$merchant_cat_id, " \
               "merchant_cat_name=$merchant_cat_name, type=$type, url=$url, logo_url=$logo_url, " \
               "click_url=$click_url, url_source=$url_source, rebate=$rebate, rebate_info=$rebate_info, " \
               "collection=$collection, click_rate=$click_rate, sale_promotion=$sale_promotion " \
               "on duplicate key update click_url=$click_url",
               sql_vars={'merchant_id':webInfo['web_id'],
                         'name':webInfo['web_name'],
                         'merchant_cat_id':webInfo['web_catid'],
                         'merchant_cat_name':self.catIdNameMap[webInfo['web_catid']],
                         'type':1,
                         'url':'test_url',
                         'logo_url':webInfo['logo_url'],
                         'click_url':webInfo['web_o_url'],
                         'url_source':1,
                         'rebate':1 if webInfo['commission'] else 2,
                         'rebate_info':webInfo['commission'],
                         'collection':0,
                         'click_rate':0,
                         'sale_promotion':1})
        
_AllianceTask = AllianceTask()
    
